import React, { useState } from "react";

const Signup = () => {
    const [name,setname]=useState("");
    const [email,setemail]=useState("");
    const [password,setpassword]=useState("");
  return (
      <div>
        <h1>Register</h1>
        <input className="inputbox" type="text" value={name} onChange={(e)=>setname.e.target.name} placeholder="Enter name"/>
        <input className="inputbox" type="text" value={email} onChange={(e)=>setpassword.e.target.password} placeholder="Enter email"/>
        <input className="inputbox" type="text" value={password} onChange={(e)=>setpassword.e.target.password} placeholder="Enter password"/>
        <button type="button">Signup</button>
      </div>
  );
};

export default Signup;
